+BitSet::BitMapFragmentTable::~BitMapFragmentTable() {
+    for (int index = 0; index < table_size(); index ++) {
+      Entry* e = bucket(index);
+      while (e != nullptr) {
+        Entry* tmp = e;
+        e = e->next();
+        free_entry(tmp);
+      }
+    }
+}
